public class InnerDomainUserSettingsFactory(Action<Humidifier.SageMaker.DomainTypes.UserSettings> factoryAction = null) : SubResourceFactory<Humidifier.SageMaker.DomainTypes.UserSettings>
{

    internal InnerDomainJupyterLabAppSettingsFactory JupyterLabAppSettingsFactory { get; set; }

    internal InnerDomainKernelGatewayAppSettingsFactory KernelGatewayAppSettingsFactory { get; set; }

    internal InnerDomainStudioWebPortalSettingsFactory StudioWebPortalSettingsFactory { get; set; }

    internal InnerDomainCustomPosixUserConfigFactory CustomPosixUserConfigFactory { get; set; }

    internal InnerDomainCodeEditorAppSettingsFactory CodeEditorAppSettingsFactory { get; set; }

    internal InnerDomainRStudioServerProAppSettingsFactory RStudioServerProAppSettingsFactory { get; set; }

    internal InnerDomainRSessionAppSettingsFactory RSessionAppSettingsFactory { get; set; }

    internal InnerDomainJupyterServerAppSettingsFactory JupyterServerAppSettingsFactory { get; set; }

    internal InnerDomainDefaultSpaceStorageSettingsFactory SpaceStorageSettingsFactory { get; set; }

    internal InnerDomainSharingSettingsFactory SharingSettingsFactory { get; set; }

    protected override Humidifier.SageMaker.DomainTypes.UserSettings Create()
    {
        var userSettingsResult = CreateUserSettings();
        factoryAction?.Invoke(userSettingsResult);

        return userSettingsResult;
    }

    private Humidifier.SageMaker.DomainTypes.UserSettings CreateUserSettings()
    {
        var userSettingsResult = new Humidifier.SageMaker.DomainTypes.UserSettings();

        return userSettingsResult;
    }
    public override void CreateChildren(Humidifier.SageMaker.DomainTypes.UserSettings result)
    {
        base.CreateChildren(result);

        result.JupyterLabAppSettings ??= JupyterLabAppSettingsFactory?.Build();
        result.KernelGatewayAppSettings ??= KernelGatewayAppSettingsFactory?.Build();
        result.StudioWebPortalSettings ??= StudioWebPortalSettingsFactory?.Build();
        result.CustomPosixUserConfig ??= CustomPosixUserConfigFactory?.Build();
        result.CodeEditorAppSettings ??= CodeEditorAppSettingsFactory?.Build();
        result.RStudioServerProAppSettings ??= RStudioServerProAppSettingsFactory?.Build();
        result.RSessionAppSettings ??= RSessionAppSettingsFactory?.Build();
        result.JupyterServerAppSettings ??= JupyterServerAppSettingsFactory?.Build();
        result.SpaceStorageSettings ??= SpaceStorageSettingsFactory?.Build();
        result.SharingSettings ??= SharingSettingsFactory?.Build();
    }

} // End Of Class

